window.bookSummaryJSON = "<p>Boring. Invisible. Pretty for a plus-size girl. Those were all the things I felt about myself, thanks to my chosen career as an accountant and society’s depiction of the perfect female. For once, I wanted to be something - no, someone - different. So, I booked a trip to Vegas for my birthday. Then, in walked Soul Matthias, treating me and my body as anything but ordinary. He lit a fire inside of me. However, it wasn’t real. </p> <p>Player. Bad boy. High-risk. That’s what the blogs depicted me as. That’s what baseball owners banked on to lowball my contract extension. I didn’t care about social media, but I definitely cared about my money. I had to get my act together. Then, in strutted Alexa Livingston. A breath of fresh air, someone completely different from what I had ever been used to. But what we had wasn’t real. It was just a marriage contract. Or was it?</p>"; 
